import React, { Component } from "react";

export default class User extends Component {
  componentDidMount = () => {
    this.props.GetUser();
  };
  render() {
    console.log(this.props);
    return (
      <div>
        <div>Redux training</div>
        {this.props &&
          this.props.userData.map(user => {
            return (
              <div>
                <div>{user.login}</div>
              </div>
            );
          })}
      </div>
    );
  }
}
